import React from "react";
import PropTypes from "prop-types";

class App extends React.Component {
  state = {
    isLoading: true,
    movies: [],
  };

  componentDidMount() {
    setTimeout(() => {
      this.setState({ isLoading: false });
    }, 3000);
  }

  componentDidUpdate() {}

  render() {
    const { isLoading } = this.state;

    return <div>{isLoading ? "Loading..." : "We are Ready"}</div>;
  }
}

export default App;
